import React from "react";
import styles from "./HeavyTextGray.module.css";

const HeavyTextGray = (props) => {
    const className = props.className || styles.HeavyTextGray;

    return (
        <p
            className={className}
            style={{
                fontSize: props.fontSize,
                color: props.color,
                margin: props.margin
            }}
        >
            {props.text}
        </p>
    );
}

export default HeavyTextGray;
